TerrestrialReferenceFrame = pyxb.binding.basis.element(pyxb.namespace.ExpandedName(Namespace, 'TerrestrialReferenceFrame'), TerrestrialReferenceFrameType, documentation='A terrestrial reference frame is a geodetic reference frame (or geodetic datum in previous GML parlance) in which the coordinates of reference or definition monuments are allowed to move. In essence, a terrestrial reference frame is continuously "realised" with the regular addition of new observations on a weekly or daily time scale. To use a terrestrial reference frame, up-to-date transformation products must be available to propagate coordinates and their uncertanties between epochs and between frames.\n            \n            To derive a static reference frame (a GML datum) from a terrestrial reference frame and a dynamic transformation, the source and target epochs of the dynamic transformation are required to compute coordinates in the realisation epoch of the static reference frame.', location=pyxb.utils.utility.Location('/home/ted/dev/geodesy/GeodesyML/schemas/referenceFrame.xsd', 21, 4))
Namespace.addCategoryObject('elementBinding', TerrestrialReferenceFrame.name().localName(), TerrestrialReferenceFrame)

DynamicTransformation = pyxb.binding.basis.element(pyxb.namespace.ExpandedName(Namespace, 'DynamicTransformation'), DynamicTransformationType, documentation='A dynamic transformation is a coordinate transformation between reference frames where at least one of which is a dynamic or terrestrial reference frame. To derive a static reference frame (a GML datum) from a terrestrial reference frame and a dynamic transformation, either the source and target epochs OR the source epoch and a relative time quantity parameter of the dynamic transformation are required to compute coordinates in the realisation epoch of the static reference frame.\n\nA transformation between reference frames in the static sense requires no temporal parameters. That is, a static reference frame (SRF) such as GDA94 can be transformed to another SRF like AGD66 with seven spatial parameters and no temporal parameters. In contrast, a dynamic reference frame (DRF) such as ITRF2008 (or the upcoming ITRF2014) requires temporal parameters to be transformed to a SRF and vice versa, and this results in the 14-parameter transformation comprised of 7 spatial and 7 temporal-spatial parameters. A fundamental requirement of the 14-parameter transformation is the provision of a time vector relative to the realisation epoch of the dynamic frame. See Dawson & Woods (2010).', location=pyxb.utils.utility.Location('/home/ted/dev/geodesy/GeodesyML/schemas/referenceFrame.xsd', 63, 4))
Namespace.addCategoryObject('elementBinding', DynamicTransformation.name().localName(), DynamicTransformation)

